import React from 'react';
import './panCss.css';
import {connect} from 'react-redux';
import {allActions} from '../../_actions'
import GridLayout from 'react-grid-layout';

class planPrint extends React.Component {
   constructor() {
      super();
      this.state = {
         colors: "green",
         hover: false,
      }
   }
   render() {
    // layout is an array of objects, see the demo for more complete usage
    const layout = [
      {i: 'a', x: 0, y: 0, w: 1, h: 2, },
      {i: 'b', x: 1, y: 0, w: 3, h: 2, minW: 2, maxW: 4},
      {i: 'c', x: 4, y: 0, w: 1, h: 2}
    ];
    return (
      <GridLayout className="layout" cols={12} rowHeight={30} width={1200}>
      <div style={{background:"red"}} key="a" data-grid={{x: 0, y: 0, w: 1, h: 2, static: true}}>a</div>
      <div style={{background:"red"}} key="b" data-grid={{x: 1, y: 0, w: 3, h: 2, minW: 2, maxW: 4}}>b</div>
      <div style={{background:"red"}} key="c" data-grid={{x: 4, y: 0, w: 1, h: 2}}>c</div>
    </GridLayout>
    )
  }

}


export default connect(allActions.mapStateToProps,allActions.mapDispatchToProps)(planPrint);
